import React from 'react';
import styled from 'styled-components';
import { NavLink, Link } from 'react-router-dom';
import LogoImage from './logo.svg'; 

const NavbarContainer = styled.nav`
  background-color: #002B5C;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 1rem 2rem;
`;

const LogoLink = styled(Link)`
  display: flex;
  align-items: center;
  text-decoration: none;
`;

const Logo = styled.img`
  height: 48px; /* Increase this for larger logo */
  width: auto;
`;

const NavLinks = styled.div`
  display: flex;
  gap: 1.5rem;
`;

const StyledLink = styled(NavLink)`
  color: white;
  text-decoration: none;
  font-family: 'Inter', sans-serif;
  font-weight: 500;
  padding-bottom: 0.2rem;
  &.active {
    border-bottom: 2px solid #004b23;
  }
  &:hover {
    opacity: 0.8;
  }
`;

const Navbar = () => {
  return (
    <NavbarContainer>
      <LogoLink to="/">
        <Logo src={LogoImage} alt="Centro Bus Predictor Logo" />
      </LogoLink>
      <NavLinks>
        <StyledLink to="/" end>Home</StyledLink>
        <StyledLink to="/tracker">Bus Tracker</StyledLink>
        <StyledLink to="/schedule">Bus Schedule</StyledLink>
      </NavLinks>
    </NavbarContainer>
  );
};

export default Navbar;
